('1831','2','8165','Apartments Gruvial',Null,'Moderne Neubauwohnungen in 1. Meeresline in Colonia de Sant Jordi','22698','In 1. Meeresline in Colonia St Jordi steht diese moderne Neubau-Wohnanlage. Von den insgesamt nur 20 Wohnungen sind noch 1 Erdgeschoss - Wohnungen frei. Die Wohnung hat 172m² Wohnfläche, aufgeteilt in 3 Schlafzimmer, 3 Bäder, Wohn-Esszimmer und offener Küche. Durch die große Fensterfront eröffnet sich ein fantastischer Blick in den ca. 350 m² großen Garten mit Privatpool und Zugang zur Strandpromenade. Die Wohnung ist ausgestattet mit einer modernen Einbauküche, Klimaanlage w/k und Panorama Alu-Schiebefenstern. \r\nPreis von 1.500.000.-€ auf 1,400.000.-. € reduziert.\r\n\r\n','22699','1400000','111','2012-07-04 12:14:25','110','2012-07-04 12:15:03',Null,'1467','167','709',1,'1','0',Null,Null,Null,'22700',Null,'0','0','0',Null,'2015-06-16 15:45:14',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'22701',Null,'22702',Null,'22703',Null,'22704',Null,'22705','0',0,'0');
